import { Container } from "react-bootstrap";

export function Home() {
    return (
      <main id="Home">
        <Container>
          <h1>Hello!</h1>
          <p>The Lord Of The Rings and everything that Tolkien created are amazing.</p>
          <p>He created his own language, then he created epic high-fantasy stories with it.</p>
          <p>This website is intented to showcase his works and as a fan myself, I am very fond of it.</p>
          If you want to check out how I designed it, please pay a visit to my GitHub account!
          Thank you!

        </Container>
      </main>
    );
  }
